import React from "react";
import Footer from "../Footer/Footer";
import Header from "../Header/Header";

export default function EventLineUps() {
  return (
    <div className="bg-[#f7f5f3] text-[#001936]">
      <Header />
      <div className="mx-[220px] grid grid-cols-1">
      {dummyData?.map((item, i) => {
        return (
          <div key={i} class="flex w-full rounded-lg bg-white shadow-lg dark:bg-neutral-700">
            <img
              class="h-96 w-full rounded-t-lg object-cover md:h-auto md:w-48 md:rounded-none md:rounded-l-lg"
              src={item.image}
              alt={item?.title}
            />
            <div class="flex flex-col justify-start p-6">
              <h5 class="mb-2 text-xl font-medium text-neutral-800 dark:text-neutral-50">
                {item?.title}
              </h5>
              <p class="mb-4 text-base text-neutral-600 dark:text-neutral-200">
                {item.description}
              </p>
              <p class="text-xs text-neutral-500 dark:text-neutral-300">
                {item.time}
              </p>
            </div>
          </div>
        );
      })}
      </div>
      <Footer />
    </div>
  );
}

const dummyData = [
  {
    image: "https://imgmedia.lbb.in/media/2021/03/603e2853c11b8c60b2210a83_1614686291389.jpg",
    title: "Paws to Volunteer: Help Animals in Shelters",
    description: "This campaign focuses on encouraging volunteers to donate their time and effort to animal shelters and rescue organizations. Volunteers can help by walking dogs, socializing with cats, assisting with animal care, and promoting adoption events. By volunteering for this campaign, you can make a positive difference in the lives of animals and help them find their forever homes.",
    time: "Last 5 min ago",
  },
  {
    image: "https://images.unsplash.com/photo-1598403531581-5c4940efd249?ixlib=rb-4.0.3&ixid=MnwxMjA3fDB8MHxzZWFyY2h8OHx8YW5pbWFsJTIwY2FyZXxlbnwwfHwwfHw%3D&auto=format&fit=crop&w=500&q=60",
    title: "Wildlife Watchers: Monitor and Protect Endangered Species",
    description: "This campaign aims to recruit volunteers to help monitor and protect endangered species in their natural habitats. Volunteers can assist with wildlife surveys, habitat restoration, and education and outreach programs. By volunteering for this campaign, you can help to safeguard threatened species and their ecosystems for future generations.",
    time: "Last 30 Min Ago",
  },
  {
    image: "https://images.unsplash.com/photo-1532598735201-8932203d3004?ixlib=rb-4.0.3&ixid=MnwxMjA3fDB8MHxzZWFyY2h8MTF8fGFuaW1hbCUyMGNhcmV8ZW58MHx8MHx8&auto=format&fit=crop&w=500&q=60",
    title: "Pet Therapy: Bring Joy to Those in Need",
    description: "This campaign focuses on bringing therapy animals to hospitals, nursing homes, and other institutions to bring joy and comfort to those in need. Volunteers can help by training their own pets to become therapy animals, or by assisting with animal-assisted therapy programs. By volunteering for this campaign, you can make a positive impact on the lives of people and animals alike.",
    time: "2 days ago",
  },
  {
    image: "https://images.unsplash.com/photo-1444212477490-ca407925329e?ixlib=rb-4.0.3&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=1228&q=80",
    title: "Pets are Family: End Animal Abuse and Neglect",
    description: "This campaign focuses on raising awareness about animal abuse and neglect and promoting responsible pet ownership. Donations can help to support animal welfare organizations that provide shelter, medical care, and rehabilitation for animals that have been abused or neglected. By supporting this campaign, you can help to create a safer and more compassionate world for all animals.",
    time: "1 Day Ago",
  },
];
